import React from "react";
import Banner from "../../components/Banner/Banner";
import ErrorBoundary from "../../components/ErrorBoundary";
import NavBar from "../../components/NavBar/NavBar";

function Browse() {
  return (
    <div className="app">
      <NavBar />
      <ErrorBoundary>
        <Banner />
      </ErrorBoundary>
    </div>
  );
}

export default Browse;
